// SPDX-License-Identifier: MIT

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";

pragma solidity ^0.8.12;

    enum InfluencerContractStatus{PENDING, ACCEPTED, DECLINED, FINISHED_SUCCESSFULLY, FINISHED_UNSUCCESSFULLY}

    struct Campaign {

        uint256 id;
        address ownerWalletAddress;
        string productUrl;
        uint256 targetReach;
        uint256 targetLikes;
        uint256 budget;
        uint256 milestoneAmount;
        uint256 duration;
        bool active;
    }

    struct InfluencerContract {

        uint256 id;
        uint256 campaignId;
        address influencerWalletAddress;
        string tweetUrl;
        uint256 targetReach;
        uint256 targetLikes;
        uint256 milestoneAmount;
        uint256 endDate;
        InfluencerContractStatus status;
    }

contract POI is ChainlinkClient, ConfirmedOwner {

    using Chainlink for Chainlink.Request;

    //events
    event CampaignCreated(uint256 id, address ownerWalletAddress, string productUrl, uint256 targetReach, uint256 targetLikes, uint256 budget, uint256 milestoneAmount, uint256 duration);
    event CampaignFundsDeposited(uint256 id, uint256 amount);
    event CampaignFundsWithdrawn(uint256 id, uint256 amount);
    event InfluencerContractCreated(uint256 id, uint256 campaignId, address influencerWalletAddress, uint256 endDate);
    event InfluencerContractAccepted(uint256 id, string tweetUrl);
    event InfluencerContractDeclined(uint256 id);
    event InfluencerContractFinished(uint256 id, InfluencerContractStatus status);
    event TweetDataReturned(uint256 reach, uint256 likes);

    uint256 public currentCampaignId = 0;
    uint256 public currentInfluencerContractId = 0;

    mapping(uint256 => Campaign) public campaignMap;
    mapping(uint256 => InfluencerContract) public influencerContractMap;
    mapping(bytes32 => uint256) requestIdToInfluencerContractIdMap;

    address public developmentWalletAddress;

    uint256 public transactionFeePercent = 10;

    bytes32 private jobId;
    uint256 private fee;

    constructor(address _developmentWalletAddress) ConfirmedOwner(msg.sender) {
        setChainlinkToken(0x779877A7B0D9E8603169DdbD7836e478b4624789);
        setChainlinkOracle(0x6090149792dAAeE9D1D568c9f9a6F6B46AA29eFD);
        jobId = "7d80a6386ef543a3abb52817f6707e3b";
        fee = (1 * LINK_DIVISIBILITY) / 10;
        // 0,1 * 10**18 (Varies by network and job)
        developmentWalletAddress = _developmentWalletAddress;
    }

    function calculateTransactionFee(uint256 amount) private view returns (uint256) {
        return amount * transactionFeePercent / 10 ** 2;
    }

    function createCampaign(string calldata productUrl, uint256 targetReach, uint256 targetLikes, uint256 milestoneAmount, uint256 duration) payable external {
        require(msg.value >= milestoneAmount, "CampaignBudget should be greater or equals than milestoneAmount.");
        currentCampaignId = currentCampaignId + 1;
        campaignMap[currentCampaignId] = Campaign(currentCampaignId, msg.sender, productUrl, targetReach, targetLikes, msg.value, milestoneAmount, duration, true);
        //emit event
        emit CampaignCreated(currentCampaignId, msg.sender, productUrl, targetReach, targetLikes, msg.value, milestoneAmount, duration);
    }

    function acceptCampaign(uint256 campaignId) external {
        require(campaignMap[campaignId].id != 0, "Campaign with given id does not exists.");
        require(campaignMap[campaignId].ownerWalletAddress != msg.sender, "You are owner of this campaign.");
        require(campaignMap[campaignId].budget >= campaignMap[campaignId].milestoneAmount, "Not enough funds currently in campaign.");
        //accept campaign
        currentInfluencerContractId = currentInfluencerContractId + 1;
        uint256 endDate = block.timestamp + campaignMap[campaignId].duration;
        influencerContractMap[currentInfluencerContractId] = InfluencerContract(currentCampaignId, campaignId, msg.sender, "",
            campaignMap[campaignId].targetReach, campaignMap[campaignId].targetLikes, campaignMap[campaignId].milestoneAmount, endDate, InfluencerContractStatus.PENDING);
        //update campaign budget
        campaignMap[campaignId].budget = campaignMap[campaignId].budget - campaignMap[campaignId].milestoneAmount;
        //emit event
        emit InfluencerContractCreated(currentInfluencerContractId, campaignId, msg.sender, endDate);
    }

    function acceptInfluencerContract(uint256 id, string calldata tweetUrl) external {
        require(influencerContractMap[id].id != 0, "InfluencerContract with given id does not exists.");
        require(campaignMap[influencerContractMap[id].campaignId].ownerWalletAddress == msg.sender, "You are not the owner of this campaign.");
        require(influencerContractMap[id].status == InfluencerContractStatus.PENDING, "InfluencerContract is not in PENDING status.");
        //accept influencer contract
        influencerContractMap[id].status = InfluencerContractStatus.ACCEPTED;
        influencerContractMap[id].tweetUrl = tweetUrl;
        //emit event
        emit InfluencerContractAccepted(id, tweetUrl);
    }

    function declineInfluencerContract(uint256 id) external {
        require(influencerContractMap[id].id != 0, "InfluencerContract with given id does not exists.");
        require(campaignMap[influencerContractMap[id].campaignId].ownerWalletAddress == msg.sender, "You are not the owner of this campaign.");
        require(influencerContractMap[id].status == InfluencerContractStatus.PENDING, "InfluencerContract is not in PENDING status.");
        //accept influencer contract
        influencerContractMap[id].status = InfluencerContractStatus.DECLINED;
        //update campaign budget
        campaignMap[influencerContractMap[id].campaignId].budget = campaignMap[influencerContractMap[id].campaignId].budget + influencerContractMap[id].milestoneAmount;
        //emit event
        emit InfluencerContractDeclined(id);
    }

    function depositFundsToCampaign(uint256 id) payable external {
        require(campaignMap[id].id != 0, "Campaign with given id does not exists.");
        require(campaignMap[id].ownerWalletAddress == msg.sender, "You are not the owner of this campaign.");
        //deposit funds
        campaignMap[id].budget = campaignMap[id].budget + msg.value;
        //emit event
        emit CampaignFundsDeposited(id, msg.value);
    }

    function withdrawFundsFromCampaign(uint256 id, uint256 amount) external {
        require(campaignMap[id].id != 0, "Campaign with given id does not exists.");
        require(campaignMap[id].ownerWalletAddress == msg.sender, "You are not the owner of this campaign.");
        require(campaignMap[id].budget >= amount, "Not enough funds currently in campaign.");
        //withdraw funds
        payable(campaignMap[id].ownerWalletAddress).transfer(amount);
        campaignMap[id].budget = campaignMap[id].budget - amount;
        //emit event
        emit CampaignFundsWithdrawn(id, amount);
    }

    function finishInfluencerContract(uint256 id, uint256 targetReach, uint256 targetLikes) public {
        require(influencerContractMap[id].id != 0, "InfluencerContract with given id does not exists.");
        require(influencerContractMap[id].status == InfluencerContractStatus.ACCEPTED, "InfluencerContract is not in ACCEPTED status.");
        require(block.timestamp >= influencerContractMap[id].endDate, "Still not end date.");
        //update influencer contract status
        if (targetReach >= influencerContractMap[id].targetReach && targetLikes >= influencerContractMap[id].targetReach) {
            //transfer money to influencer
            payable(influencerContractMap[id].influencerWalletAddress).transfer(influencerContractMap[id].milestoneAmount - calculateTransactionFee(influencerContractMap[id].milestoneAmount));
            influencerContractMap[id].status = InfluencerContractStatus.FINISHED_SUCCESSFULLY;
        } else {
            influencerContractMap[id].status = InfluencerContractStatus.FINISHED_UNSUCCESSFULLY;
        }
        //emit event
        emit InfluencerContractFinished(id, influencerContractMap[id].status);
    }

    function request(uint256 influencerContractId) public {
        Chainlink.Request memory req = buildChainlinkRequest('7d80a6386ef543a3abb52817f6707e3b', address(this), this.fulfill.selector);
        req.add(
            'get',
            string.concat('http://ec2-18-188-160-250.us-east-2.compute.amazonaws.com:8080/api/v1/tweet', influencerContractMap[influencerContractId].tweetUrl)
        );
        req.add('path', 'data,tweetReachAndLikes');
        bytes32 requestId = sendChainlinkRequest(req, (1 * LINK_DIVISIBILITY) / 10);
        requestIdToInfluencerContractIdMap[requestId] = influencerContractId;
        // 0,1*10**18 LINK
    }

    function fulfill(bytes32 _requestId, string calldata _data) public recordChainlinkFulfillment(_requestId) {
        splitAndEmit(_requestId, _data);
    }

    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(chainlinkTokenAddress());
        require(
            link.transfer(msg.sender, link.balanceOf(address(this))),
            "Unable to transfer"
        );
    }

    function splitAndEmit(bytes32 _requestId, string calldata input) public {
        bytes memory inputBytes = bytes(input);
        bytes memory tokenBytes = ",";

        uint256 tokenIndex = indexOf(inputBytes, tokenBytes);

        require(tokenIndex != inputBytes.length, "Token not found in the input string");

        // Extract the first part of the string
        string memory firstPart = substring(inputBytes, 0, tokenIndex);

        // Extract the second part of the string
        string memory secondPart = substring(inputBytes, tokenIndex + tokenBytes.length, inputBytes.length);

        uint256 reach = convertStringToUint(firstPart);
        uint256 likes = convertStringToUint(secondPart);

        finishInfluencerContract(requestIdToInfluencerContractIdMap[_requestId], reach, likes);

        // Emit the strings as an event
        emit TweetDataReturned(reach, likes);
    }

    function indexOf(bytes memory input, bytes memory token) internal pure returns (uint256) {
        for (uint256 i = 0; i < input.length - token.length; i++) {
            bool found = true;
            for (uint256 j = 0; j < token.length; j++) {
                if (input[i + j] != token[j]) {
                    found = false;
                    break;
                }
            }
            if (found) {
                return i;
            }
        }
        return input.length;
    }

    function substring(bytes memory input, uint256 startIndex, uint256 endIndex) internal pure returns (string memory) {
        require(startIndex <= endIndex && endIndex <= input.length, "Invalid start or end index");

        string memory result = new string(endIndex - startIndex);
        bytes memory resultBytes = bytes(result);

        for (uint256 i = startIndex; i < endIndex; i++) {
            resultBytes[i - startIndex] = input[i];
        }

        return string(resultBytes);
    }

    function convertStringToUint(string memory str) private pure returns (uint256 value) {

        bytes memory b = bytes(str);
        uint256 number = 0;
        for (uint i = 0; i < b.length; i++) {
            number = number << 4;
            // or number = number * 16
            number |= numberFromAscII(b[i]);
            // or number += numberFromAscII(b[i]);
        }
        return number;
    }

    function numberFromAscII(bytes1 b) private pure returns (uint8 res) {
        if (b >= "0" && b <= "9") {
            return uint8(b) - uint8(bytes1("0"));
        } else if (b >= "A" && b <= "F") {
            return 10 + uint8(b) - uint8(bytes1("A"));
        } else if (b >= "a" && b <= "f") {
            return 10 + uint8(b) - uint8(bytes1("a"));
        }
        return uint8(b);
        // or return error ...
    }
}
